import SysMessageModal from './modules/SysMessageModal'
import {JeecgListMixin} from '@/mixins/JeecgListMixin'
import JEllipsis from "@/components/jeecg/JEllipsis";

export default {
  name: "SysMessageList",
  mixins: [JeecgListMixin],
  components: {
    JEllipsis,
    SysMessageModal
  },
  data() {
    return {
      description: '消息管理页面',
      // 新增修改按钮是否显示
      show: false,
      // 表头
      columns: [
        {
          title: '#',
          dataIndex: '',
          key: 'rowIndex',
          width: 60,
          align: "center",
          customRender: function (t, r, index) {
            return parseInt(index) + 1;
          }
        },
        {
          title: '消息标题',
          align: "center",
          dataIndex: 'esTitle'
        },
        {
          title: '发送内容',
          align: "center",
          dataIndex: 'esContent',
          scopedSlots: {customRender: 'esContent'},
        },
        {
          title: '接收人',
          align: "center",
          dataIndex: 'esReceiver'
        },
        {
          title: '发送次数',
          align: "center",
          dataIndex: 'esSendNum'
        },
        {
          title: '发送状态',
          align: 'center',
          dataIndex: 'esSendStatus_dictText'
        },
        {
          title: '发送时间',
          align: "center",
          dataIndex: 'esSendTime'
        },
        {
          title: '发送方式',
          align: 'center',
          dataIndex: 'esType_dictText'
        },
        {
          title: '操作',
          dataIndex: 'action',
          align: "center",
          scopedSlots: {customRender: 'action'},
        }
      ],
      url: {
        list: "/message/sysMessage/list",
        delete: "/message/sysMessage/delete",
        deleteBatch: "/message/sysMessage/deleteBatch",
        exportXlsUrl: "message/sysMessage/exportXls",
        importExcelUrl: "message/sysMessage/importExcel",
      },
    }
  },
  computed: {
    importExcelUrl: function () {
      return `${window._CONFIG['domianURL']}/${this.url.importExcelUrl}`;
    }
  },
  methods: {}
}
